import {Icon, Typography, Select, Paper, IconButton, Button} from '@material-ui/core';

export default function DisplayPaper(props)
{
    return(

    <Paper className="w-full rounded-8 shadow-none border-1">
        <div className="text-center pt-12 pb-28">
            <Typography
                className="text-72 leading-none text-blue">25</Typography>
            <Typography className="text-16" color="textSecondary">Courses Offerings</Typography>
        </div>
        <div className="flex items-center px-16 h-52 border-t-1">
            <Typography className="text-15 flex w-full" color="textSecondary">
                By Faculties
            </Typography>
        </div>
    </Paper>
    );
}
